export var SliderOrientation;
(function (SliderOrientation) {
    SliderOrientation["horizontal"] = "horizontal";
    SliderOrientation["vertical"] = "vertical";
})(SliderOrientation || (SliderOrientation = {}));
export var SliderMode;
(function (SliderMode) {
    SliderMode["singleValue"] = "singleValue";
    SliderMode["adustUpperValue"] = "adustUpperValue";
    SliderMode["adustLowerValue"] = "adjustLowerValue";
    SliderMode["adjustBoth"] = "adjustBoth";
})(SliderMode || (SliderMode = {}));
